import App from "../../App";
import LoginForm from "./LoginForm";

function SelectRule() {
    return (
        <div>
            <button onClick={App}>Admin</button>
            <button onClick={App}>Store Staff</button>
            <button onClick={App}>Warranty Staff</button>
        </div>
    )
}
export default SelectRule;
